import React from "react";
import ReactFullpage from "@fullpage/react-fullpage";
import "./FullPageStyles.css";

class FullpageWrapper extends React.Component {

  render() {
    return (
      <ReactFullpage
        scrollOverflow
        sectionsColor={["orange", "purple", "green", "blue", "pink", "black"]}
        menu={"#myMenu"}
        anchors={["Home", "About", "Resume", "Projects", "Gallery", "Contact"]}
        navigation
        navigationPosition={"right"}
        navigationTooltips={["Home", "About", "Resume", "Projects", "Gallery", "Contact"]}
        // onLeave={this.onLeave.bind(this)}
        // afterLoad={this.afterLoad.bind(this)}
        render={({ state, fullpageApi }) => {
          return (
            <div id="fullpage-wrapper">
              <div className="section home-section">
                <h3>hi. i'm James.</h3>
              </div>
              <div className="section about-section">
                <h3>About Me</h3>
                <p>Hi!

                  My name is James, and I'm from the sunny island of Singapore.

                  I'm a current undergrad at Duke University, double majoring in Computer Science and Economics. I am deeply passionate in the application of computer science in solving real world problems, and aspire to pursue a career in the field of Software Design and Big Data in the near future.

                  During my free time (and when my wallet allows), I immensely enjoy traveling. This website is dedicated to showcasing some of the many landscapes and places I have documented during my trips.
                </p>
              </div>
              <div className="section resume-section">
                <h3>Resume</h3>
              </div>
              <div className="section projects-section">
                <h3>Projects</h3>
              </div>
              <div className="section gallery-section">
                <h3>Gallery</h3>
              </div>
              <div className="section contact-section">
                <h3>Contact</h3>
                <button onClick={() => fullpageApi.moveTo(1, 0)}>
                  Move top
                </button>
              </div>
            </div>
          );
        }}
      />
    );
  }
}

export default FullpageWrapper;
